CREATE DEFINER=`ghopw`@`%` FUNCTION `GetHigherLevelCARLIBKey`(inLocation varchar(20),
inTrunkId varchar(20),
inUnitType varchar(20)) RETURNS varchar(100) CHARSET utf8
    READS SQL DATA
BEGIN

declare rtnData varchar(100);

set rtnData = NULL;	

select
um1.carlib_key
into
rtnData
from
unit_relationships ur
join unit_master um1 on ur.ancestor_unit_id = um1.id
join unit_type_master ut1 on um1.unit_type_id = ut1.id
join unit_master um2 on ur.descendant_unit_id = um2.id
join unit_type_master ut2 on um2.unit_type_id = ut2.id
where
ut1.trunk_id = inTrunkId and ut1.unit_type = inUnitType and
um2.carlib_key = inLocation and ut2.unit_type = 'Location'
limit 1;

return rtnData;

END ;;
DELIMITER ;
