CREATE DEFINER=`ghopw`@`%` FUNCTION `GetHigherLevelUser`(inLocation varchar(20),
inTrunkId varchar(20),
inUnitType varchar(20)) RETURNS varchar(50) CHARSET utf8
    READS SQL DATA
BEGIN

declare rtnData varchar(50);

set rtnData = NULL;	

select
usrm.display_name
into
rtnData
from
unit_relationships ur
join unit_master um1 on ur.ancestor_unit_id = um1.id
join unit_type_master ut1 on um1.unit_type_id = ut1.id
join unit_master um2 on ur.descendant_unit_id = um2.id
join unit_type_master ut2 on um2.unit_type_id = ut2.id
join user_assignments ua1 on um1.id = ua1.unit_id
join user_master usrm on ua1.user_id = usrm.id
where
ut1.trunk_id = inTrunkId and ut1.unit_type = inUnitType and
um2.carlib_key = inLocation and ut2.unit_type = 'Location' and 
ua1.responsible_user = 1 
limit 1;

return rtnData;

END ;;
