CREATE DEFINER=`roliv`@`%` PROCEDURE `AddUnitMaster`(IN inUnitTypeId int(11), IN inUnitName varchar(100), inCARLIBKey varchar(20),
                                 OUT outErrDesc varchar(100), OUT insertedRecID int(11))
AddUnit_label:BEGIN


declare recCount int(11);


set outErrDesc = '';


select count(*)
into recCount
from unit_master
where unit_type_id = inUnitTypeId and unit_name = inUnitName;

if recCount > 0 then
	set outErrDesc = 'Unit with that name and unit type already exists';
	LEAVE AddUnit_label;
end if;


set recCount = 0;

select count(*)
into recCount
from unit_type_master
where id = inUnitTypeId;

if recCount = 0 then
	set outErrDesc = 'Invalid unit type.';
	LEAVE AddUnit_label;
end if;


insert into unit_master
	(unit_type_id,unit_name,carlib_key)
values
	(inUnitTypeId,inUnitName,inCARLIBKey);


select
	last_insert_id()
into
	insertedRecID;


insert into unit_relationships
	(ancestor_unit_id,descendant_unit_id,relationship_depth)
values
	(insertedRecID,insertedRecID,0);

END ;;
DELIMITER ;
