CREATE DEFINER=`root`@`localhost` PROCEDURE `GetLocationsByUser`(IN `inUserProfile` VARCHAR(20))
    SQL SECURITY INVOKER
    COMMENT 'Retrieve a list of locations that the user is authorized to.'
BEGIN

select a.carlib_key as location_code, a.unit_name as location_name
from unit_master a
	join user_master b on (inUserProfile)=(b.user_profile) 
	join unit_type_master c on (a.unit_type_id)=(c.id) 
where b.all_locations = true and b.status = true and c.unit_type = "Location"
union 

select d.carlib_key as location_code, d.unit_name as location_name
from user_assignments a
	join user_master        b on (a.user_id)=(b.id)
	join unit_relationships c on (a.unit_id)=(c.ancestor_unit_id)
	join unit_master        d on (c.descendant_unit_id)=(d.id)
	join unit_type_master   e on (d.unit_type_id)=(e.id)
where b.user_profile = inUserProfile and b.status = true and e.unit_type = "Location"
order by 1;

END ;;
