CREATE DEFINER=`roliv`@`%` PROCEDURE `MoveUnit`(IN movingUnit int(11), IN targetUnit int(11), OUT outErrDesc varchar(100))
GraftUnit_label:BEGIN


declare movingUnitTrunk   varchar(20);
declare movingUnitSortSeq int(11);
declare targetUnitTrunk   varchar(20);
declare targetUnitSortSeq int(11);
declare pruneErrDesc      varchar(100);


set outErrDesc = '';

if movingUnit = targetUnit then
	set outErrDesc = 'Units must be different';
	LEAVE GraftUnit_label;
end if;


select
	utm.trunk_id, utm.sort_sequence
into
	movingUnitTrunk, movingUnitSortSeq
from
	unit_master um
	join unit_type_master utm on um.unit_type_id = utm.id
where
	um.id = movingUnit;

select
	utm.trunk_id, utm.sort_sequence
into
	targetUnitTrunk, targetUnitSortSeq
from
	unit_master um
	join unit_type_master utm on um.unit_type_id = utm.id
where
	um.id = targetUnit;


if movingUnitTrunk <> targetUnitTrunk then
	set outErrDesc = 'Units must be in the same trunk';
	LEAVE GraftUnit_label;
end if;


if movingUnitSortSeq <= targetUnitSortSeq then
	set outErrDesc = 'Unit levels are invalid';
	LEAVE GraftUnit_label;
end if;


call PruneUnit(movingUnit, pruneErrDesc);

if pruneErrDesc <> ' ' then
	set outErrDesc = pruneErrDesc;
	LEAVE GraftUnit_label;
end if;


insert into unit_relationships
	(ancestor_unit_id, descendant_unit_id, relationship_depth)
select
	prime.ancestor_unit_id, secondary.descendant_unit_id, prime.relationship_depth+secondary.relationship_depth+1
from
	unit_relationships as prime
	join unit_relationships as secondary
where
	secondary.ancestor_unit_id = movingUnit AND prime.descendant_unit_id = targetUnit;

END ;;
DELIMITER ;
